import Link from 'next/link'

import Navbar from './navbar'

import style from '../styles/layout/layout.module.css'

export default function Layout({children, home}) {
  console.log(children)
  console.log(home)
  return (
    <div className={style.body}>
      <Navbar />
      <section>
        {children}
      </section>
    </div>
  )
}
